import React, {useState} from 'react';
import data from "../restaurant-menu.json";

function Dessert() {
const [menu] = useState(data.array.categorys[4]["menu-items"]);

    return (
        <div className="card">
            <ul>
                {menu.map((item)=>{
                    return(
                        <li>
                            <div>
                                <img src={item.images} alt=""/>
                                <h4>{item.name}</h4>
                            </div>
                        </li>
                    );
                })}
            </ul>
        </div>
    )
}

export default Dessert
